import React, { useContext } from 'react'
import './Logo.css'
import { Link, useNavigate } from 'react-router-dom'
import Context from '../../helper/Context'

export default function Logo() {

    const navigate = useNavigate()
    const weatherContext = useContext(Context)

    const onClick = (e) => {
        e.preventDefault()
        navigate('/', { lat: weatherContext.latCity, lon: weatherContext.lonCity ,city: weatherContext.nameCity.toLowerCase()})
    }

return (
<div className='logo'>
    <Link onClick={onClick} to='/'>LogoLogo</Link>
</div>
)
}
